import React from "react";
import "home.css";
import Header from "../header/Header";

export default function Home() {
  return (
    <div
      className="Home"
      style={{
        backgroundImage:
          "url(" + "https://tsks.app/img/hero-app-preview.png" + ")",
      }}
    >
      <Header />

      <h1>Todo App</h1>
      <p>
        Keep track of the daily tasks in life and get that satisfaction upon
        copletion.
      </p>
      <div className="home__buttons">
        <div className="home__button button btn--bg-pink">get started</div>
        <div className="home__button button btn--bg-gray">learn more</div>
      </div>
    </div>
  );
}
